  \"2015-09-26T23:01:23.251800\",\n\t\"name\": \"national-marine-sanctuary-digital-boundary-files\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Office of National Marine Sanctuaries
  manages a system of sanctuaries and other managed areas around the country. The
  legal boundaries of these sanctuaries are defined within the Code of Federal Regulations,
  at 15 C.F.R. Part 922 and the subparts for each national marine sanctuary. The GIS
  compatible digital boundary files for each national marine sanctuary are representations
  of those legal boundaries are based on the best available data. These files are
  available for public use at locations defined in this metadata record.\",\n\t\"license_title\":
